import React from "react";
import NavBar from "./components/navbar";
import Counters from "./components/counters";
import "./App.css";
import TimerDisplay from "./components/timerDisplay";

function App() {
  return (
    <React.Fragment>
      <div class="sidenav">
        <a href="#">About</a>
        <a href="#">Services</a>
        <a href="#">Clients</a>
        <a href="#">Contact</a>
      </div>
      <NavBar />
      <main className="container">
        <TimerDisplay />
      </main>
    </React.Fragment>
  );
}

export default App;
